INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('04165547', 'Amarula', 'INGREDIENTS: Sugar, cocoa mass, cocoa butter, Amarula 8.5%, whole milk powder, skimmed milk powder, butter fat, emulsifier (soya lecithin), natural vanilla extract. Cocoa: Minimum 37% in chocolate. Contains milk, soya. May contain traces of peanuts and other nuts, egg or gluten. INGRÉDIENTS: SUcre, pâte de cacao, beurre de cacao, Amarula 8.5%, lait entier en poudre, lait écrémé en poudre, beurre fondu, émulsifiant (lécithine de soja), extrait naturel de vanille. Cacao: 37% min. dans le chocolat. Peut contenir des traces d\'arachides et d\'autres fruits à coque, d\'oeuf et de gluten. ZUTATEN: Zucker, Kakaomasse, Kakaobutter, Amarula® 8.5%, Vollmilchpulver Magermilchpulver, Butterreinfett, Emulgator (Sojalezithin), natürliches Vanille-Extrakt. Kakao: 37%mind. in der Schokolade. Kann Spuren von Erdnüssen und anderen Schalenfrüchten, Ei und Gluten enthalten. INGREDIENTES: azúcar, pasta de cacao, manteca de cacao, Amarula 8.5% , leche entera en polvo, leche desnatada en polvo, mantequilla derretida, emulsionante (lecitina de soja), extracto natural de vainilla. Cocoa:37% in chocolate. Puede contener trazas de cacahuetes y otros frutos secos, huevo y gluten. ، حليب جاف 3.52MARUA کامل ،الدسمالمحتويات: سكر، معجون الكاکاو، زيدة الكاكاو، كونياك حليب جاف منزوع الدسسم، زبدة سائحة، مستحلب )ليستین الصویا)، نكهة الفانللا .الطبيعية الكاآكاو 37على اأقل فى آلشوكولاته. قد يحتوي على آثار من آلفول السودانی والكسرات : الأخرى، والبيض والغلوتین', 'https://static.openfoodfacts.org/images/products/04165547/front_en.4.400.jpg', '26', '16', '55', '53', '', '5', '0.142', '0.0559055118110236', '3.9', '0');

